"use strict";(self.webpackChunkweslley_io=self.webpackChunkweslley_io||[]).push([[2021],{5923:function(e){e.exports=JSON.parse('{"route":"talks","tag":"Brasil","articles":[{"title":"DevFest Cerrado (Google Developer Groups \u2014 GDG)","slug":"devfest-cerrado-google-developer-groups-gdg-mentoria-2025","date":"2025-12-13T14:35:00Z","authors":["Weslley Ara\xfajo"],"tags":["Brasil","GO","Goi\xe2nia"],"content":"\\n\ud83c\udf93 **Mentoring:** Open Source and its ecosystem \u2728\\n\\n:::note Summary\\n\\nOpen mentoring session on open source, introducing topics and hosting a relaxed **Q&A** for developers of all levels.\\n\\n:::\\n\\n{/* truncate */}\\n\\nimport { Moments } from \'@Moments\';\\n\\n<hr />\\n\\nSome of the topics covered:\\n\\n- Why should I contribute to open source?\\n- How do I find projects to contribute to?\\n- How can we attract contributors to our projects?\\n- How do we ensure consistency and standardization in our _codebase_ when accepting contributions from around the world?\\n- When and how to reject contributions?\\n- And, of course, much more \u2728\\n\\n<hr />\\n\\n<Moments\\n  moments={[\\n    { src: \'/img/talks/devfest-cerrado-2025/moments/13.jpg\' },\\n    { src: \'/img/talks/devfest-cerrado-2025/moments/08.jpg\' },\\n    { src: \'/img/talks/devfest-cerrado-2025/moments/09.jpg\' },\\n    { src: \'/img/talks/devfest-cerrado-2025/moments/10.jpg\' },\\n    { src: \'/img/talks/devfest-cerrado-2025/moments/11.jpg\' },\\n    { src: \'/img/talks/devfest-cerrado-2025/moments/12.jpg\' },\\n    { src: \'/img/talks/devfest-cerrado-2025/moments/14.jpg\' },\\n    { src: \'/img/talks/devfest-cerrado-2025/moments/15.jpg\' },\\n    { src: \'/img/talks/devfest-cerrado-2025/moments/16.jpg\' },\\n    {\\n      src: \'/img/talks/devfest-cerrado-2025/moments/19.jpeg\',\\n      alt: \'Paulo Handerson (PorteraTech) and me\',\\n    },\\n    { src: \'/img/talks/devfest-cerrado-2025/moments/17.png\' },\\n    { src: \'/img/talks/devfest-cerrado-2025/moments/18.jpeg\' },\\n  ]}\\n/>\\n","filePath":"devfest2.mdx","mdxPath":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/12/13/devfest2.mdx","summary":[],"description":"\ud83c\udf93 **Mentoring:** Open Source and its ecosystem \u2728\\n\\n:::note Summary\\n\\nOpen mentoring session on open source, introducing topics and hosting a relaxed **Q&A** for developers of all levels.\\n\\n:::","social":"./banner2.jpeg","socialPath":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/12/13/banner2.jpeg","readingTime":1,"lastModified":"2026-02-24T11:55:39.000Z","authorsData":[{"name":"Weslley Ara\xfajo","title":"Active open-source contributor, Microsoft MVP, MySQL2\'s maintainer and Poku\'s creator \u2728","url":"https://weslley.io/en/","image_url":"/img/avatar.png","socials":{"linkedin":"wellwelwel","github":"wellwelwel","instagram":"wellwelwel","youtube":"weslleyio"}}],"nextArticle":{"title":"DevFest Cerrado (Google Developer Groups \u2014 GDG)","slug":"devfest-cerrado-google-developer-groups-gdg-2025","description":"\ud83c\udf99\ufe0f **Talk:** From Code to the Real World: The Meeting Point between Data, Testing and Security\\n\\n:::note Summary\\n\\nWe\'ll demystify everything you know about development and explore how to make our application predictable against the unpredictable.\\n\\n:::","social":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/12/13/banner.jpeg"}},{"title":"DevFest Cerrado (Google Developer Groups \u2014 GDG)","order":-2,"slug":"devfest-cerrado-google-developer-groups-gdg-2025","date":"2025-12-13","authors":["Weslley Ara\xfajo"],"tags":["Brasil","GO","Goi\xe2nia"],"content":"\\n\ud83c\udf99\ufe0f **Talk:** From Code to the Real World: The Meeting Point between Data, Testing and Security\\n\\n:::note Summary\\n\\nWe\'ll demystify everything you know about development and explore how to make our application predictable against the unpredictable.\\n\\n:::\\n\\n{/* truncate */}\\n\\nimport { Moments } from \'@Moments\';\\nimport { Side } from \'@Side\';\\n\\n<hr />\\n\\n<Side id=\\"resume\\">\\n\\nTesting our application\'s functionality? That\'s easy.\\nBreaking our application before the user or an attacker does? That\'s different.\\n\\nMore than testing, you\'ll learn to build truly secure systems and understand in practice the impact of data being transformed in the worst possible way: through real attacks.\\n\\nAnd if you think security is only about code, even the LGPD will be covered here from the perspective of someone who managed to access our database in full.\\n\\nYou\'ll realize that tests aren\'t an extra task: they are part of our application and essential for both digital and human security.\\n\\n</Side>\\n\\n<Side id=\'moments\'>\\n  <Moments\\n    moments={[\\n      { src: \'/img/talks/devfest-cerrado-2025/moments/01.jpg\' },\\n      { src: \'/img/talks/devfest-cerrado-2025/moments/02.jpg\' },\\n      { src: \'/img/talks/devfest-cerrado-2025/moments/03.jpg\' },\\n      { src: \'/img/talks/devfest-cerrado-2025/moments/04.jpg\' },\\n      { src: \'/img/talks/devfest-cerrado-2025/moments/05.jpg\' },\\n      { src: \'/img/talks/devfest-cerrado-2025/moments/06.jpg\' },\\n      { src: \'/img/talks/devfest-cerrado-2025/moments/07.jpg\' },\\n      { src: \'/img/talks/devfest-cerrado-2025/moments/14.jpg\' },\\n      { src: \'/img/talks/devfest-cerrado-2025/moments/15.jpg\' },\\n      { src: \'/img/talks/devfest-cerrado-2025/moments/16.jpg\' },\\n      { src: \'/img/talks/devfest-cerrado-2025/moments/17.png\' },\\n      { src: \'/img/talks/devfest-cerrado-2025/moments/18.jpeg\' },\\n    ]}\\n\\n/>\\n\\n</Side>\\n\\n<Side id=\'study\'>\\n\\nThe theoretical side of the talk, showing all exploited vulnerabilities, their respective impacts and technical mitigation measures through **OWASP** and **CWEs**.\\n\\nStudy and reference repository on **GitHub**:\\n\\n- [github.com/wellwelwel/devfest-cerrado-2025](https://github.com/wellwelwel/devfest-cerrado-2025) (portuguese only)\\n\\n:::note\\nDue to the approach that demonstrates vulnerabilities working in practice, this slide is exclusive to those who attended the talk in person \ud83e\udd1d\\n:::\\n\\n</Side>\\n","filePath":"devfest.mdx","mdxPath":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/12/13/devfest.mdx","summary":[],"description":"\ud83c\udf99\ufe0f **Talk:** From Code to the Real World: The Meeting Point between Data, Testing and Security\\n\\n:::note Summary\\n\\nWe\'ll demystify everything you know about development and explore how to make our application predictable against the unpredictable.\\n\\n:::","social":"./banner.jpeg","socialPath":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/12/13/banner.jpeg","readingTime":1,"lastModified":"2026-02-24T11:55:39.000Z","sides":[{"id":"moments","label":"Moments \ud83c\udf9e\ufe0f"},{"id":"resume","label":"Summary \ud83d\udcdd"},{"id":"study","label":"Study Material \ud83d\udcda"}],"authorsData":[{"name":"Weslley Ara\xfajo","title":"Active open-source contributor, Microsoft MVP, MySQL2\'s maintainer and Poku\'s creator \u2728","url":"https://weslley.io/en/","image_url":"/img/avatar.png","socials":{"linkedin":"wellwelwel","github":"wellwelwel","instagram":"wellwelwel","youtube":"weslleyio"}}],"previousArticle":{"title":"DevFest Cerrado (Google Developer Groups \u2014 GDG)","slug":"devfest-cerrado-google-developer-groups-gdg-mentoria-2025","description":"\ud83c\udf93 **Mentoring:** Open Source and its ecosystem \u2728\\n\\n:::note Summary\\n\\nOpen mentoring session on open source, introducing topics and hosting a relaxed **Q&A** for developers of all levels.\\n\\n:::","social":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/12/13/banner2.jpeg"},"nextArticle":{"title":"Dev Refer\xeancias","slug":"dev-referencias","description":"\ud83c\udf99\ufe0f **Talk:** How to Become a Reference in Tech\\n\\n:::note Summary\\n\\n\ud83d\udca1 A talk that brings unique insights and knowledge on how to create **impact** and **inspiration** through what we do.\\n\\n:::","social":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/11/08/banner.jpeg"}}]}')}}]);